import React from 'react';

import main from '../../img/main.jpg';

import './main.styles.scss';

const Main = () => (
    <section className='main'>
        <img src={main} alt='Photo Main' className='main__img'></img>
        <div className='main__content'>
            <h2 className='main__text'>All Kinds of apparels you can dream of!</h2>
            <button className='main__button'>Explore Our Collections</button>
        </div>
        
    </section>
)

export default Main;
